(function() {
    const targets = ['Anwesenheitsbeginn stempeln', 'Pause / Anwesenheitsende stempeln'];
    let timer;
    new MutationObserver(() => {
        document.querySelectorAll('button[data-test="ws-info-button"]:not(.highlighted)').forEach(btn => {
            if (!btn.disabled && targets.includes(btn.getAttribute('aria-label'))) {
                btn.disabled = true;
                btn.style.opacity = '0.5';
                btn.style.pointerEvents = 'none';
            }
        });
        if (!timer) {
            const sub = document.querySelector('.modal-header-subtitle');
            if (sub) {
                const tick = () => sub.textContent = 'Sekunden bis zur n√§chsten Minute: ' + (59 - new Date().getSeconds());
                tick();
                timer = setInterval(tick, 1000);
            }
        }
        const ucg = document.querySelector('[data-test="ws-use-case-group-container"]');
        if (ucg && !ucg.dataset.styled) {
            ucg.dataset.styled = '1';
            Object.assign(ucg.style, {
                backgroundPosition: 'bottom',
                backgroundRepeat: 'no-repeat',
                backgroundImage: 'url(data:image/png;base64,)'
            });
        }
    }).observe(document.body, { childList: true, subtree: true });
})();
